    def table_from_dict(self, dict_data: dict, table_style=""):
        r = f"<table>"
        if table_style != "":
            r = f"<table style=\"{table_style}\">"
        for k, v in dict_data.items():
            r = r + "<tr>"
            r = r + f"<td>{k}</td>"
            if isinstance(v, dict):
                r = r + f"<td>{self.table_from_dict(v)}</td>"
            else:
                r = r + f"<td>{v}</td>"
            r = r + "</tr>"
        r = r + "</table>"
        return r

    def table_from_dict_items(self, dict_items: list[tuple]):
        r = "<table>"
        for k, v in dict_items:
            r = r + "<tr>"
            r = r + f"<td>{k}</td>"
            r = r + f"<td>{v}</td>"
            r = r + "</tr>"
        r = r + "</table>"
        return r

    def treeview_from(self, tree: PayloadAnalysisResult):
        if len(tree.children) > 0:
            r = (f"<li><span class=\"caret\" id=\"{tree.tree_id}\">{tree.tree_id}"
                 f"<div class=\"p_headers\">"
                 f"Headers<br>{self.table_from_dict_items(tree.payload_headers)}"
                 f"</div>"
                 f"<div class=\"p_analysis\">"
                 f"Analysis<br>{self.html_for_strategy_result(tree.strategies_results)}"
                 f"</div></span>")
            for t in tree.children:
                r = r + "<ul class=\"nested\">"
                r = r + self.treeview_from(t)
                r = r + "</ul>"
        else:
            r = (f"<li>{tree.tree_id}"
                 f"<div class=\"p_headers\">"
                 f"Headers<br>{self.table_from_dict_items(tree.payload_headers)}"
                 f"</div>"
                 f"<div class=\"p_analysis\">"
                 f"Analysis<br>{self.html_for_strategy_result(tree.strategies_results)}"
                 f"</div>")
        r = r + "</li>"
        return r

    def html_for_lists(self, ls):
        r = "<table>"
        for elem in ls:
            r = r + "<tr>"
            r = r + f"<td>{elem}</td>"
            r = r + "</tr>"
        r = r + "</table>"
        return r

    def html_for_strategy_result(self, srl: list[StrategyResult]):
        html = ""
        for sr in srl:
            domain_feed_matches = ""
            for dfm in sr.domain_feed_matches:
                domain_feed_matches = domain_feed_matches + self.table_from_dict(dfm,
                                                                                 "border-top: 3px solid black; border-bottom: 3px solid black; margin-bottom: 3px;")
            html = html + f"""<table>
                    <tr>
                    <td style="border-right: 3px solid black">URL</td><td>{self.html_for_lists(sr.urls)}</td>
                    </tr>
                    <tr>
                    <td style="border-right: 3px solid black">Domain</td><td>{self.html_for_lists(sr.domains)}</td>
                    </tr>
                    <tr>
                    <td style="border-right: 3px solid black">Domain Matches</td><td>{domain_feed_matches}</td>
                    </tr>
                    <tr>
                    <td style="border-right: 3px solid black">Hashes</td><td>{self.html_for_lists(sr.hashes)}</td>
                    </tr>
                    </table>
                """
        return html


